import {Link} from "react-router-dom";

export default function Navbar() {
    return (
            <nav>
                <div className='logo'>

                </div>
              <div className="topnav">
                <a className="active" href="/">Home</a>
                <a href="/login">Login</a>
                <a href="/signup">Signup</a>
                <a href="/about">About</a>
              </div>
            </nav>
    )
}
